import React, { Component } from 'react';
import '../App.css';
import gql from 'graphql-tag';
const GET_LOGO = gql`
  {
    logos {
      _id
      name
      texts {
      text
      left
      top
      color
      fontSize
      backgroundColor
      borderColor
      borderRadius
      borderWidth
      padding
      margin
    }
    images {
      src
      left
      top
      height
      width
    }
      lastUpdate
    }
  }
`;
class PreviewCanvas extends Component {
    constructor(props) {
        super();
        console.log(props);

    };
    render() {
        return (
            <div id="canvas_container">
                <div className="green" style={{
                    padding: "1rem",
                    fontSize: 24,
                    textAlign: "center"
                }
                }>Preview</div>
                <canvas id="preview_canvas"></canvas>
            </div>
        );
    }
}

export default PreviewCanvas;
